import React from 'react';
import { Link } from 'react-router-dom';
import { Navbar, Nav } from 'react-bootstrap';

const NavBar = () => {
  return (
    <div className="NavBar">
      <ul>
        <li><span className="NavBarItems col-sm-1">Boxing</span></li>
        <li><span className="NavBarItems">CrossFit</span></li>
        <li><span className="NavBarItems">Yoga</span></li>
        <li><span className="NavBarItems">Pilate</span></li>
        <li><span className="NavBarItems">Exercise</span></li>
        <li><span className="NavBarItems">Health</span></li>
        <li><span className="NavBarItems">Exercise</span></li>
        <li><span className="NavBarItems">Health</span></li>
      </ul>
    </div>
  );
};

export default NavBar;
